import TopTitle from "./../Header";
import SignUpForm from "./../SignUpForm";
import Footer from "./../Footer";

const SignUpPage = () => {

  return (
    <>
      <TopTitle />
      <SignUpForm />
      <Footer />
    </>
  );
};

export default SignUpPage;
